function Task(props){
    let [list = []] = props
    console.log('=====list====', list)
    return (
        <ul>
            {
                list.map(item => (
                    <li key={item.id}><span>{item.text}</span></li>
                ))
            }
            <li></li>
        </ul>
    )
}

export default Task;
